script: |
  super -f text -I q6184.spq | sort > q6184.out

inputs:
  - name: q6184.spq
    data: |
      SELECT DISTINCT + ( col2 ) * - 18 * - ( + col0 ) + - ( col2 * - cor0.col1 ) + - col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q6184.out
    data: |
      38012
      4212
      54644
